import React, { useState } from 'react';
import  {AppBar, Toolbar, styled ,Typography, IconButton, Drawer, List, ListItem, ListItemIcon, ListItemText, Button, Menu, MenuItem, Box } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircle from '@mui/icons-material/AccountCircle';
import HomeIcon from '@mui/icons-material/Home';
import TrendingUpIcon from '@mui/icons-material/TrendingUp';
import ChatIcon from '@mui/icons-material/Chat';
import AnnouncementIcon from '@mui/icons-material/Announcement';
import PublicIcon from '@mui/icons-material/Public';
import ThumbUpIcon from '@mui/icons-material/ThumbUp';
import MusicNoteIcon from '@mui/icons-material/MusicNote';
import EmailIcon from '@mui/icons-material/Email';
import TrafficIcon from '@mui/icons-material/Traffic';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
const drawerWidth = 240;
const drawerWidthClosed = 60; // Width to keep icons visible

const DrawerHeader = styled('div')(({ theme }) => ({
  display: 'flex',
  alignItems: 'center',
  padding: theme.spacing(0, 1),
  // necessary for content to be below app bar
  ...theme.mixins.toolbar,
}));
const Layout = ({ children }) => {
    const [open, setOpen] = useState(true);

    const handleDrawerToggle = () => {
        setOpen(!open);
    };

    const [sidebarOpen, setSidebarOpen] = useState(true);
    const [anchorEl, setAnchorEl] = useState(null);
    const [menuAnchorEl, setMenuAnchorEl] = useState(null);
    const isMenuOpen = Boolean(anchorEl);
    const isSubMenuOpen = Boolean(menuAnchorEl);

    const handleSidebarToggle = () => {
        setSidebarOpen(!sidebarOpen);
    };

    const handleProfileMenuOpen = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleMenuClose = () => {
        setAnchorEl(null);
        setMenuAnchorEl(null);
    };

    const handleSubMenuOpen = (event) => {
        setMenuAnchorEl(event.currentTarget);
    };

    const menuItems = [
        { text: 'Top Stocks', icon: <TrendingUpIcon />, action: handleSubMenuOpen },
        { text: 'Data Bits', icon: <HomeIcon /> },
        { text: 'Reddit Mentions', icon: <ChatIcon /> },
        { text: 'News Mentions', icon: <AnnouncementIcon /> },
        { text: '4chan Mentions', icon: <PublicIcon /> },
        { text: 'Instagram Followers', icon: <ThumbUpIcon /> },
        { text: 'Facebook Followers', icon: <ThumbUpIcon /> },
        { text: 'TikTok Followers', icon: <MusicNoteIcon /> },
        { text: 'Threads Followers', icon: <EmailIcon /> },
        { text: 'Webpage Traffic', icon: <TrafficIcon /> }
    ];
    return (
        <Box sx={{ display: 'flex' }}>
            <AppBar position="static" sx={{ color: 'black', backgroundColor: '#ffffff', minHeight: '50px' }}>
                <Toolbar>
                    <IconButton
                        edge="start"
                        color="inherit"
                        aria-label="open drawer"
                        onClick={handleSidebarToggle}
                        sx={{ mr: 2 }}
                    >
                        <MenuIcon />
                    </IconButton>
                    <Typography variant="h6" noWrap component="div" sx={{ flexGrow: 1, fontFamily: 'Roboto', fontWeight: 500 }}>
                        AltIndex
                    </Typography>
                    <IconButton
                        edge="end"
                        aria-label="account of current user"
                        aria-haspopup="true"
                        onClick={handleProfileMenuOpen}
                        color="inherit"
                    >
                        <AccountCircle />
                    </IconButton>
                    <Menu
                        id="profile-menu"
                        anchorEl={anchorEl}
                        open={isMenuOpen}
                        onClose={handleMenuClose}
                    >
                        <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
                        <MenuItem onClick={handleMenuClose}>My account</MenuItem>
                    </Menu>
                </Toolbar>
            </AppBar>
           <Drawer
                variant="permanent"
                sx={{
                    width: open ? drawerWidth : drawerWidthClosed,
                    flexShrink: 0,
                    '& .MuiDrawer-paper': {
                        width: open ? drawerWidth : drawerWidthClosed,
                        boxSizing: 'border-box',
                    },
                }}
                open={open}
            >
                <DrawerHeader />
                <List>
                    {menuItems.map((item, index) => (
                        <ListItem button key={item.text}>
                            <ListItemIcon>{item.icon}</ListItemIcon>
                            {open && <ListItemText primary={item.text} />}
                        </ListItem>
                    ))}
                </List>
            </Drawer>
            <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
                <DrawerHeader />
                {children}
            </Box>
        </Box>
    );
};

export default Layout;
